          <input
            type="text"
            className="search__bar"
            placeholder="Search by location or branch"
          />
          <select className="search__bar" defaultValue={'default'}>
            <option value="default"> Select Status</option>
            <option value="Status 1"> Status 1</option>
            <option value="Status 2"> Status 2</option>
            <option value="Status 3"> Status 3</option>
            <option value="Status 4"> Status 4</option>
          </select>
        </div>
        <div className="">
          <button className="btn btn-primary p-25">Add Branch</button>
        </div>
      </section>

      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 650 }} size="small" aria-label="Officers Table">
          <TableHead>
            <TableRow>
              {columns.map((column) => (
                <TableCell>{column.label}</TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            <TableRow>
              <TableCell className="b-r">
              Abuja
              </TableCell>
              <TableCell> Kubwa</TableCell>
              <TableCell> 
              29
              </TableCell>
              <TableCell> 34 </TableCell>
              <TableCell>
                {" "}
                <div className="badge bg-success">Open</div>{" "}
              </TableCell>
              <TableCell>
                {" "}
                <MoreVertIcon />{" "}
              </TableCell>
            </TableRow>


            <TableRow>
              <TableCell className="b-r">
              Abuja
              </TableCell>
              <TableCell> Mpape</TableCell>
              <TableCell>4</TableCell>
              <TableCell>19 </TableCell>
              <TableCell>
                {" "}
                <div className="badge bg-error">Closed</div>{" "}
              </TableCell>
              <TableCell>
                {" "}
                <MoreVertIcon />{" "}
              </TableCell>
            </TableRow>
            <TableRow>
              <TableCell className="b-r">
              Abuja
              </TableCell>
              <TableCell> Kubwa</TableCell>
              <TableCell> 
              29
              </TableCell>
              <TableCell> 34 </TableCell>
              <TableCell>
                {" "}
                <div className="badge bg-success">Open</div>{" "}
              </TableCell>
              <TableCell>
                {" "}
                <MoreVertIcon />{" "}
              </TableCell>
            </TableRow>
          </TableBody>
        </Table>
      </TableContainer>
    </section>
  );
};

export default Branches;
